import React from 'react';
import { Container, Typography, Button, Box } from '@mui/material';
import { Link } from 'react-router-dom';

const Landing = () => {
    return (
        <Box
            sx={{
                minHeight: 'calc(100vh - 64px)', // Adjust if navbar height is different
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                background: 'linear-gradient(135deg, #0D47A1 0%, #1976D2 100%)', // Professional and calming blue gradient
                color: 'white',
                textAlign: 'center',
                p: 3,
            }}
        >
            <Container maxWidth="md">
                <Typography
                    variant="h2"
                    component="h1"
                    gutterBottom
                    sx={{ fontWeight: 'bold' }}
                >
                    Secure Second Opinions.
                </Typography>
                <Typography variant="h5" component="p" sx={{ my: 3, opacity: 0.9 }}>
                    Direct, AI-matched consultations for medical professionals.
                </Typography>
                <Button
                    variant="contained"
                    component={Link}
                    to="/register"
                    size="large"
                    sx={{
                        mt: 4,
                        backgroundColor: 'white',
                        color: '#1976D2',
                        '&:hover': {
                            backgroundColor: '#f0f0f0',
                        }
                    }}
                >
                    Start Consulting
                </Button>
            </Container>
        </Box>
    );
};

export default Landing;
